import React, { useState } from 'react';
import { Menu } from 'antd';
import { HomeOutlined, BarChartOutlined, TableOutlined, LogoutOutlined} from '@ant-design/icons';
import logoUrl from '../images/logo-dark.png';
import LogoutButton from './LogoutButton';

const { SubMenu } = Menu;
const menuKeys = ['1', '2', '3'];

function Sider() {

    const [openKeys, setOpenKeys] = useState(['1']);

    const onOpenChange = keys => {
      const latestOpenKey = keys.find(key => openKeys.indexOf(key) === -1);
      if (menuKeys.indexOf(latestOpenKey) === -1) {
        setOpenKeys(keys);
      } else {
        setOpenKeys(latestOpenKey ? [latestOpenKey] : []);
      }
    };

    return (
        <>
        <div className="logo">
          <a  href="https://techstars.com">
          <img src={logoUrl} alt="techstarts icon" />
          </a>
        </div>
        <Menu style={{background:'black', border:'none'}} mode="inline" openKeys={openKeys} onOpenChange={onOpenChange}>
          <SubMenu key="sub1" icon={<HomeOutlined style={{color:'#39C463'}} />} title="Navigation One">
          <Menu.Item key="sub1"></Menu.Item>
          </SubMenu>
          <Menu.Item key="2" icon={<BarChartOutlined style={{color:'#39C463'}} />}>
            Dashboard
          </Menu.Item>
          <Menu.Item key="3" icon={<TableOutlined style={{color:'#39C463'}}/>}>
            Results
          </Menu.Item>
          <Menu.Item key="4" icon={<LogoutOutlined style={{color:'#39C463'}}/>}>
            <LogoutButton/>
          </Menu.Item>
        </Menu>
        </>
    )
}
export default Sider;
